import { useAuth } from "../../Context/auth"

const Profile = () => {

  const [auth,setAuth]=useAuth();
  const history = useHistory();
const checkuser=()=>{
  if(!auth.user){
    history.push("/Login");
  }
}
useEffect(()=>{
  checkuser();
},[]);

  return (
    <>

        <h1 style={{margin:"200px"}}>Profile Page</h1>
<pre>{JSON.stringify(auth,null,4)}</pre>
    </>
  )
}

export default Profile;
